import React from 'react';
import { useAuth0 } from "@auth0/auth0-react";
import JSONPretty from 'react-json-pretty'; // Full Data

const Profile = () => {
    const { user, isLoading, isAuthenticated } = useAuth0();
    var sub = ""
    if (isAuthenticated && user.sub != null) // Get auth0 unique user id
        sub = user.sub

    return (
        isAuthenticated && <div>
            {/* <JSONPretty data={user} /> Full Data*/}
            <p>User Email : {user.email}, Verified {user.email_verified}</p>
            <p>User Unique Auth0 ID : {sub}</p>
            <p>User Family Name : {user.family_name}</p>
            <p>User Given Name : {user.given_name}</p>
            <p>User Role : {window.$role}</p>
        </div>
    ) 
}

export default Profile;
